def do_operation(c,op,v):
    c = int(c)
    v = int(v)
    if op == '>':
        return c > v
    elif op == '<':
        return c < v
    elif op == '<=':
        return c <= v
    elif op == '>=':
        return c >= v
    elif op == '!=':
        return c != v
    elif op == '==':
        return c == v
    else:
        raise "invalid operator {}".format(op)

